import axios from "axios"
import React from "react"
import { useState, useEffect } from "react"

const Main = () => {
  const data = {
    name: "Pavel",
    numberPhone: "66666",
  }
  function postData(data) {
    axios
      .post("http://localhost:5000/api/call", data)
      .then((res) => console.log(res))
  }

  return (
    <main className="main">
      <button onClick={postData(data)}>Отправить</button>
    </main>
  )
}

export default Main
